import React from 'react'
import './Banner.css';
import logo from '../images/profile.png'



class Banner extends React.Component {
    render(){
        return (
        <>
            <img className="feature" src={this.props.imageSrc} />
            <p className="playlist">PLAYLIST</p>
            <h2>This is </h2>
			
        </>
        )
    }
}

export default Banner;
